Happy #SHARKWEEK! Sharks are amazing, but they’re also in a lot of trouble. Fins from as many as 73 million sharks end up in the global shark fin trade every year, and the demand for fins is one of the greatest threats facing sharks. While shark finning is illegal in U.S. waters, shark fins continue to be bought and sold throughout the United States. Bipartisan legislation to ban the U.S. shark fin trade has already passed the House and awaits final passage in the Senate. You can help Oceana right now by telling your senators to pass the Shark Fin Sales Elimination Act, before it’s too late.
